import React from 'react';
import ReactStoreIndicator from 'react-score-indicator'
class Tutorialscore extends React.Component{
    constructor(props){
        super(props);
        this.state=this.props.location;
        console.log(this.state)
    }
    render(){
        return(
           <div className="container1">
               <p>{this.state.tutorial_name} <ReactStoreIndicator value={this.state.user_score} maxValue={this.state.total_score}/></p>
           </div>
        )
    }
}
export default Tutorialscore;
